module.exports = {"title":"Volvo Vermant Cup","date":"2019-04-17T00:00:00.000Z","bodyContent":"<p>Zaterdag 20 en maandag 22 april a.s. vindt de Volvo Vermant-Cup van K. Kontich F.C. plaats. In dit tweedaagse paastornooi &ndash; dit jaar aan haar 50<sup>e</sup> editie toe &ndash; strijden maar liefst 80 jeugdteams voor de fel begeerde Volvo Vermant-Cup.</p>\n<p><strong>De Vermant Automotive Group ondersteunt vanaf dit seizoen dit tweedaagse jeugdtornooi</strong>. Vermant vierde vorig jaar haar 50-jarig bestaan en telt intussen maar liefst drie Volvo-garages, namelijk in Mechelen (Walem), Bornem en Rumst.</p>\n<p>Naast de bovengenoemde Volvo-concessies verruimde Vermant haar aanbod met Kia-wagens, die zij &ndash; naast hun vestiging in Mechelen &ndash; ook in Aartselaar verkoopt. De multi-merkencarrosserie vervolledigt het aanbod.</p>\n<p><strong>Het paradepaardje van Vermant is echter het recent opgerichte &lsquo;Collection By Vermant&rsquo;</strong>, een afdeling van de groep die zich specialiseert in de verkoop van klassieke en collectiewagens. Bedoeling van Guy Vermant (gedelegeerd bestuurder) is dan ook om gepassioneerde liefhebbers samen te&nbsp; brengen en goed te begeleiden bij de aankoop en het onderhoud van hun oldtimer.</p>\n<div class=\"center\">\n<img src=\"https://collectionbyvermant.be/sites/default/files/styles/car_teaser/public/2019-03/1_1.jpg?itok=pDUs5lRu\" alt=\"Vermant collection\" />\n</div><br>\n<p>Op het paastornooi kan u alvast de laatste nieuwe modellen van Volvo Vermant bekijken, maar bezoek zeker eens de garages van Volvo &amp; Kia Vermant. Je vindt ze op volgende adressen:</p>\n<ul>\n  <li><strong>Volvo Vermant Mechelen</strong> - Antwerpsesteenweg 271 te Mechelen</li>\n  <li><strong>Volvo Vermant Rumst</strong> &ndash; Sint-Jozefstraat 12 te Rumst</li>\n  <li><strong>Volvo Vermant Bornem</strong> &ndash; Puursesteenweg 380 te Bornem</li>\n  <li><strong>Kia Mechelen</strong> &ndash; Generaal De Wittelaan 8 te Mechelen</li>\n  <li><strong>Kia Aartselaar</strong> &ndash; Boomsesteenweg 4 te Aartselaar</li>\n</ul>\n<p>Kontich F.C. wenst Volvo Vermant hartelijk te bedanken voor hun erg gewaardeerde steun tijdens &eacute;&eacute;n van de sportieve hoogtepunten van ons seizoen!</p>","bodyHtml":"<p>Zaterdag 20 en maandag 22 april a.s. vindt de Volvo Vermant-Cup van K. Kontich F.C. plaats. In dit tweedaagse paastornooi &ndash; dit jaar aan haar 50<sup>e</sup> editie toe &ndash; strijden maar liefst 80 jeugdteams voor de fel begeerde Volvo Vermant-Cup.</p>\n<p><strong>De Vermant Automotive Group ondersteunt vanaf dit seizoen dit tweedaagse jeugdtornooi</strong>. Vermant vierde vorig jaar haar 50-jarig bestaan en telt intussen maar liefst drie Volvo-garages, namelijk in Mechelen (Walem), Bornem en Rumst.</p>\n<p>Naast de bovengenoemde Volvo-concessies verruimde Vermant haar aanbod met Kia-wagens, die zij &ndash; naast hun vestiging in Mechelen &ndash; ook in Aartselaar verkoopt. De multi-merkencarrosserie vervolledigt het aanbod.</p>\n<p><strong>Het paradepaardje van Vermant is echter het recent opgerichte &lsquo;Collection By Vermant&rsquo;</strong>, een afdeling van de groep die zich specialiseert in de verkoop van klassieke en collectiewagens. Bedoeling van Guy Vermant (gedelegeerd bestuurder) is dan ook om gepassioneerde liefhebbers samen te&nbsp; brengen en goed te begeleiden bij de aankoop en het onderhoud van hun oldtimer.</p>\n<div class=\"center\">\n<img src=\"https://collectionbyvermant.be/sites/default/files/styles/car_teaser/public/2019-03/1_1.jpg?itok=pDUs5lRu\" alt=\"Vermant collection\" />\n</div><br>\n<p>Op het paastornooi kan u alvast de laatste nieuwe modellen van Volvo Vermant bekijken, maar bezoek zeker eens de garages van Volvo &amp; Kia Vermant. Je vindt ze op volgende adressen:</p>\n<ul>\n  <li><strong>Volvo Vermant Mechelen</strong> - Antwerpsesteenweg 271 te Mechelen</li>\n  <li><strong>Volvo Vermant Rumst</strong> &ndash; Sint-Jozefstraat 12 te Rumst</li>\n  <li><strong>Volvo Vermant Bornem</strong> &ndash; Puursesteenweg 380 te Bornem</li>\n  <li><strong>Kia Mechelen</strong> &ndash; Generaal De Wittelaan 8 te Mechelen</li>\n  <li><strong>Kia Aartselaar</strong> &ndash; Boomsesteenweg 4 te Aartselaar</li>\n</ul>\n<p>Kontich F.C. wenst Volvo Vermant hartelijk te bedanken voor hun erg gewaardeerde steun tijdens &eacute;&eacute;n van de sportieve hoogtepunten van ons seizoen!</p>","preview":"Zaterdag 20 en maandag 22 april a.s. vindt de Volvo Vermant-Cup van K. Kontich F.C. plaats. In dit tweedaagse","dir":"content/build/nieuws/2018-2019/algemeen","base":"volvo-vermant-cup.json","ext":".json","sourceBase":"volvo-vermant-cup.md","sourceExt":".md"};

