module.exports = {"title":"Inschrijvingen Volvo Vermant Cup (Paastornooi) open!","date":"2018-09-09T00:00:00.000Z","cloudinaryID":"174_vtkble","bodyContent":"<p><strong>K. Kontich FC organiseert dit seizoen het 50ste Paastornooi voor jeugdelftallen, dit jaar ook de <strong>Volvo-Vermant Cup genoemd!</strong></strong></p>\n<div class=\"center\">\n<img src=\"https://www.link2fleet.be/wp-content/uploads/2018/04/Logo-Vermant-Groep.png\" style=\"max-width: 100%; height: auto;\" alt=\"Volvo Vermant Cup 2019\">\n</div>\n<p>Het tornooi gaat door op zaterdag 20 april 2019 voor de U10-U11-U12 en U13 en op maandag 22 april 2019 voor de U6-U7-U8 en U9.</p>\n<p>Inschrijven is vanaf nu mogelijk, dit gebeurt via het online formulier.</p>\n<div> <a class=\"btn-block\" href=\"http://kkontichfc.be/jeugd/paastornooi/inschrijven\" title=\"Klik hier om je ploeg in te schrijven\">Klik hier om je ploeg in te schrijven</a></div><br>","bodyHtml":"<p><strong>K. Kontich FC organiseert dit seizoen het 50ste Paastornooi voor jeugdelftallen, dit jaar ook de <strong>Volvo-Vermant Cup genoemd!</strong></strong></p>\n<div class=\"center\">\n<img src=\"https://www.link2fleet.be/wp-content/uploads/2018/04/Logo-Vermant-Groep.png\" style=\"max-width: 100%; height: auto;\" alt=\"Volvo Vermant Cup 2019\">\n</div>\n<p>Het tornooi gaat door op zaterdag 20 april 2019 voor de U10-U11-U12 en U13 en op maandag 22 april 2019 voor de U6-U7-U8 en U9.</p>\n<p>Inschrijven is vanaf nu mogelijk, dit gebeurt via het online formulier.</p>\n<div> <a class=\"btn-block\" href=\"http://kkontichfc.be/jeugd/paastornooi/inschrijven\" title=\"Klik hier om je ploeg in te schrijven\">Klik hier om je ploeg in te schrijven</a></div><br>","preview":"K. Kontich FC organiseert dit seizoen het 50ste Paastornooi voor jeugdelftallen, dit jaar ook de Volvo-Vermant","dir":"content/build/nieuws/2018-2019/evenementen","base":"inschrijvingen-volvo-vermant-cup.json","ext":".json","sourceBase":"inschrijvingen-volvo-vermant-cup.md","sourceExt":".md"};

