module.exports = {"title":"Ontdekkingsdagen K. Kontich F.C.","date":"2019-03-25T00:00:00.000Z","bodyContent":"<p>Tijdens de weken van 15 en 22 april organiseert K. Kontich F.C. ontdekkingsdagen voor kinderen geboren in 2015 t.e.m. 2006.</p>\n<p>Alle kinderen, ongeacht hun voetbalkwaliteiten en/of &ndash;ervaring, zijn die weken welkom om volledig gratis en vrijblijvend deel te nemen aan enkele ontdekkingstrainingen.</p>\n<p>Via&nbsp;<a title=\"https://goo.gl/forms/SLgBva2dNkTILcfZ2\" href=\"https://goo.gl/forms/SLgBva2dNkTILcfZ2\" target=\"_blank\" rel=\"noopener\">deze link</a>&nbsp;kan u uw zoon of dochter inschrijven. Vervolgens krijgt u van onze jeugdco&ouml;rdinatoren de gegevens van de trainer die de leeftijdscategorie waartoe uw zoon/dochter behoort coacht en kan u met hem twee dagen afspreken waarop uw zoon/dochter eens kan komen meetrainen.</p>\n<p><strong>Inschrijven kan tot en met woensdag 10 april.</strong></p>\n<p><a class=\"btn-block\" href=\"https://goo.gl/forms/SLgBva2dNkTILcfZ2\" target=\"_blank\" title=\"Klik hier om in te schrijven\">Klik hier om in te schrijven</a></p>","bodyHtml":"<p>Tijdens de weken van 15 en 22 april organiseert K. Kontich F.C. ontdekkingsdagen voor kinderen geboren in 2015 t.e.m. 2006.</p>\n<p>Alle kinderen, ongeacht hun voetbalkwaliteiten en/of &ndash;ervaring, zijn die weken welkom om volledig gratis en vrijblijvend deel te nemen aan enkele ontdekkingstrainingen.</p>\n<p>Via&nbsp;<a title=\"https://goo.gl/forms/SLgBva2dNkTILcfZ2\" href=\"https://goo.gl/forms/SLgBva2dNkTILcfZ2\" target=\"_blank\" rel=\"noopener\">deze link</a>&nbsp;kan u uw zoon of dochter inschrijven. Vervolgens krijgt u van onze jeugdco&ouml;rdinatoren de gegevens van de trainer die de leeftijdscategorie waartoe uw zoon/dochter behoort coacht en kan u met hem twee dagen afspreken waarop uw zoon/dochter eens kan komen meetrainen.</p>\n<p><strong>Inschrijven kan tot en met woensdag 10 april.</strong></p>\n<p><a class=\"btn-block\" href=\"https://goo.gl/forms/SLgBva2dNkTILcfZ2\" target=\"_blank\" title=\"Klik hier om in te schrijven\">Klik hier om in te schrijven</a></p>","preview":"Tijdens de weken van 15 en 22 april organiseert K. Kontich F.C. ontdekkingsdagen voor kinderen geboren in 2015","dir":"content/build/nieuws/2018-2019/jeugd","base":"ontdekkingsdagen.json","ext":".json","sourceBase":"ontdekkingsdagen.md","sourceExt":".md"};

