module.exports = {"title":"Frederic Ledent naar KKFC!","figCaption":"Frederic Ledent","date":"2019-04-19T00:00:00.000Z","cloudinaryID":"176_zhj9nw","bodyContent":"<p>Gelet op de (verdiende) transfer van doelman (en speler van het jaar) <strong>Jef Snyders</strong> naar <strong>Verbroedering Geel</strong> (dit seizoen nog actief in 1e amateur), diende K. Kontich F.C. nog op zoek te gaan naar een nieuwe doelman.</p>\n<p>K. Kontich F.C. bereikte gisterenavond dan ook een akkoord met de <strong>29-jarige Frederic Ledent</strong>, die reeds meerdere jaren actief is in de nationale reeksen van ons voetbal. Na een jeugdopleiding bij Germinal Beerschot en SK Beveren, kwam Frederic op 20-jarige leeftijd terecht bij Berchem Sport om 2 jaar later onder de lat te staan bij de toenmalig vierdeklasser FC Katelijne. Na &eacute;&eacute;n seizoen bij F.C. Katelijne trok onze nieuwe doelman naar City Pirates Merksem, waar hij 3 seizoenen onder de lat stond in 4e nationale.</p>\n<p>Na een seizoen met weinig speelkansen bij Berchem Sport, speelde Frederic de voorbije 2 seizoenen bij Racing Mechelen, waarmee hij vorig seizoen de promotie bewerkstelligde.</p>\n<p>We wensen Frederic h&eacute;&eacute;l veel succes toe bij onze club en houden eraan zijn voorganger Jef Snyders te bedanken voor zijn prima prestaties en dito mentaliteit.</p>\n<p><strong>H&eacute;&eacute;l veel succes gewenst, Frederic en Jef! </strong></p>","bodyHtml":"<p>Gelet op de (verdiende) transfer van doelman (en speler van het jaar) <strong>Jef Snyders</strong> naar <strong>Verbroedering Geel</strong> (dit seizoen nog actief in 1e amateur), diende K. Kontich F.C. nog op zoek te gaan naar een nieuwe doelman.</p>\n<p>K. Kontich F.C. bereikte gisterenavond dan ook een akkoord met de <strong>29-jarige Frederic Ledent</strong>, die reeds meerdere jaren actief is in de nationale reeksen van ons voetbal. Na een jeugdopleiding bij Germinal Beerschot en SK Beveren, kwam Frederic op 20-jarige leeftijd terecht bij Berchem Sport om 2 jaar later onder de lat te staan bij de toenmalig vierdeklasser FC Katelijne. Na &eacute;&eacute;n seizoen bij F.C. Katelijne trok onze nieuwe doelman naar City Pirates Merksem, waar hij 3 seizoenen onder de lat stond in 4e nationale.</p>\n<p>Na een seizoen met weinig speelkansen bij Berchem Sport, speelde Frederic de voorbije 2 seizoenen bij Racing Mechelen, waarmee hij vorig seizoen de promotie bewerkstelligde.</p>\n<p>We wensen Frederic h&eacute;&eacute;l veel succes toe bij onze club en houden eraan zijn voorganger Jef Snyders te bedanken voor zijn prima prestaties en dito mentaliteit.</p>\n<p><strong>H&eacute;&eacute;l veel succes gewenst, Frederic en Jef! </strong></p>","preview":"Gelet op de (verdiende) transfer van doelman (en speler van het jaar) Jef Snyders naar Verbroedering Geel (dit","dir":"content/build/nieuws/2019-2020/a-kern","base":"frederic-ledent-naar-kkfc.json","ext":".json","sourceBase":"frederic-ledent-naar-kkfc.md","sourceExt":".md"};

