module.exports = {"title":"Jente Hermans naar KKFC!","figCaption":"Jente Hermans","date":"2019-02-21T00:00:00.000Z","cloudinaryID":"166_pwgiej","bodyContent":"<p>Met het oog op volgend seizoen versterkt K. Kontich F.C. zich met de 21-jarige Jente Hermans.</p>\n<p>Jente doorliep de jeugdopleiding bij KSK Lokeren en SK Lierse, waar hij nog samen voetbalde met Andreas Tindemans en Jordi Kreydt. Debuteren in een eerste elftal deed hij in 2<sup>e</sup> amateur bij KSV Bornem, waar hij als centrale verdediger zijn basisplaats wist af te dwingen gedurende meer dan 2 seizoenen.</p>\n<p>Met Jente haalt K. Kontich F.C. een voetballend sterke verdediger binnen met enorm veel power. Het bestuur van K. Kontich F.C. is dan ook bijzonder verheugd &nbsp;en wenst Jente heel veel succes toe!</p>\n<p><strong>Welkom bij K. Kontich F.C., Jente!</strong></p>","bodyHtml":"<p>Met het oog op volgend seizoen versterkt K. Kontich F.C. zich met de 21-jarige Jente Hermans.</p>\n<p>Jente doorliep de jeugdopleiding bij KSK Lokeren en SK Lierse, waar hij nog samen voetbalde met Andreas Tindemans en Jordi Kreydt. Debuteren in een eerste elftal deed hij in 2<sup>e</sup> amateur bij KSV Bornem, waar hij als centrale verdediger zijn basisplaats wist af te dwingen gedurende meer dan 2 seizoenen.</p>\n<p>Met Jente haalt K. Kontich F.C. een voetballend sterke verdediger binnen met enorm veel power. Het bestuur van K. Kontich F.C. is dan ook bijzonder verheugd &nbsp;en wenst Jente heel veel succes toe!</p>\n<p><strong>Welkom bij K. Kontich F.C., Jente!</strong></p>","preview":"Met het oog op volgend seizoen versterkt K. Kontich F.C. zich met de 21-jarige Jente Hermans.\nJente doorliep","dir":"content/build/nieuws/2019-2020/a-kern","base":"jente-hermans-naar-kkfc.json","ext":".json","sourceBase":"jente-hermans-naar-kkfc.md","sourceExt":".md"};

