module.exports = {"title":"Loting Crocky Cup","figCaption":"Crocky Cup 2019-2020","date":"2019-07-15T00:00:00.000Z","cloudinaryID":"Croky-Cup-logo-790x320_w1arwx","bodyContent":"Er werd geloot voor de Crocky Cup (Beker van Belgi). Of K. Kontich F.C. de buren van K.V. Mechelen kan opvolgen, valt zeer te betwijfelen.  \n  \nIn de  **1e ronde**  wacht onze club een uitwedstrijd op VV Minderhout (wedstrijd 103, geprogrammeerd op 28 juli a.s. om 16u00).  \nVV Minderhout degradeerde het voorbije seizoen naar 3e  provinciale.\n\nDe winnaar van het duel neemt het in de 2e  ronde op in een thuisduel tegen Olympia Wijgmaal (voorlopig voorzien op zondag 4 augustus a.s. om 16u00).  \nWijgmaal eindigde vorig seizoen knap 5e  in 2e  amateur en is dus een meer dan te duchten tegenstander.  \n  \nDe loting voor de volgende rondes is nog niet bekend.","bodyHtml":"<p>Er werd geloot voor de Crocky Cup (Beker van Belgi). Of K. Kontich F.C. de buren van K.V. Mechelen kan opvolgen, valt zeer te betwijfelen.</p>\n<p>In de  <strong>1e ronde</strong>  wacht onze club een uitwedstrijd op VV Minderhout (wedstrijd 103, geprogrammeerd op 28 juli a.s. om 16u00).<br>\nVV Minderhout degradeerde het voorbije seizoen naar 3e  provinciale.</p>\n<p>De winnaar van het duel neemt het in de 2e  ronde op in een thuisduel tegen Olympia Wijgmaal (voorlopig voorzien op zondag 4 augustus a.s. om 16u00).<br>\nWijgmaal eindigde vorig seizoen knap 5e  in 2e  amateur en is dus een meer dan te duchten tegenstander.</p>\n<p>De loting voor de volgende rondes is nog niet bekend.</p>\n","preview":"Er werd geloot voor de Crocky Cup (Beker van Belgi). Of K. Kontich F.C. de buren van K.V. Mechelen kan","dir":"content/build/nieuws/2019-2020/a-kern","base":"loting-crocky-cup.json","ext":".json","sourceBase":"loting-crocky-cup.md","sourceExt":".md"};

