module.exports = {"title":"Tivi Huygen naar KKFC!","figCaption":"Tivi Huygen","date":"2019-03-28T00:00:00.000Z","cloudinaryID":"172_oa0hgd","bodyContent":"<p>K. Kontich F.C. versterkt zich met het oog op volgend seizoen met Tivi Huygen. De 29-jarige Tivi komt over van KFC Zwarte Leeuw, waar hij sinds 2016 actief was.</p>\n<p>Tivi doorliep zijn jeugdopleiding bij Berchem Sport en R. Cappellen F.C., waar hij 9 seizoenen geleden zijn debuut maakte in de toenmalige 3<sup>e</sup> klasse. Na R. Cappellen F.C. volgden 2 seizoenen bij KFC Sint-Lenaerts (4<sup>e</sup> nationale), 3 seizoenen bij KFC Duffel (4<sup>e</sup> nationale), &eacute;&eacute;n seizoen Excelsior Kaart (1<sup>e</sup>provinciale) en 3 seizoenen bij Zwarte Leeuw (in 4<sup>e</sup> nationale/3<sup>e</sup> amateur). Tivi staat bekend omwille van zijn inzet, winnaarsmentaliteit en duelkracht.</p>\n<p><strong>Tivi, namens de ganse club wensen wij jou enorm veel succes toe. Welkom bij K. Kontich F.C.! </strong></p>","bodyHtml":"<p>K. Kontich F.C. versterkt zich met het oog op volgend seizoen met Tivi Huygen. De 29-jarige Tivi komt over van KFC Zwarte Leeuw, waar hij sinds 2016 actief was.</p>\n<p>Tivi doorliep zijn jeugdopleiding bij Berchem Sport en R. Cappellen F.C., waar hij 9 seizoenen geleden zijn debuut maakte in de toenmalige 3<sup>e</sup> klasse. Na R. Cappellen F.C. volgden 2 seizoenen bij KFC Sint-Lenaerts (4<sup>e</sup> nationale), 3 seizoenen bij KFC Duffel (4<sup>e</sup> nationale), &eacute;&eacute;n seizoen Excelsior Kaart (1<sup>e</sup>provinciale) en 3 seizoenen bij Zwarte Leeuw (in 4<sup>e</sup> nationale/3<sup>e</sup> amateur). Tivi staat bekend omwille van zijn inzet, winnaarsmentaliteit en duelkracht.</p>\n<p><strong>Tivi, namens de ganse club wensen wij jou enorm veel succes toe. Welkom bij K. Kontich F.C.! </strong></p>","preview":"K. Kontich F.C. versterkt zich met het oog op volgend seizoen met Tivi Huygen. De 29-jarige Tivi komt over van","dir":"content/build/nieuws/2019-2020/a-kern","base":"tivi-huygen-naar-kkfc.json","ext":".json","sourceBase":"tivi-huygen-naar-kkfc.md","sourceExt":".md"};

