module.exports = {"title":"Keepersschool \"Clean Sheet\"!","figCaption":"Keepersschool Clean Sheet van Jan Van Der Veer en Kris Mampaey","slider":"YES","cloudinaryID":"139_crvf4n","date":"2019-05-21T00:00:00.000Z","bodyContent":"<p>Tijdens de terugronde van het seizoen 2017-2018 organiseerden <strong>Kris Mampaey &amp; Jan Van der Veer</strong> verschillende try-outs voor de opstart van een keepersschool. Op basis van de positieve reacties &eacute;n de duidelijk waarneembare evolutie van de deelnemende keepers, werd beslist om keepersschool &lsquo;Clean Sheet&rsquo; boven het doopvont te houden.</p>\n<h3>Wat is &lsquo;Clean Sheet&rsquo;?</h3>\n<p>&lsquo;Clean Sheet&rsquo; is de keepersschool van niemand minder dan Kris Mampaey &eacute;n Jan Van Der Veer.</p>\n<p><strong>Kris Mampaey</strong> was profvoetballer in de periode van 1991 tot 2005 en stond onder de lat bij S.K. Lierse, Willem II Tilburg (waar hij onder andere Champions League speelde), het Schotse Dunfermline, R. Antwerp F.C. en F.C. Den Bosch, terwijl <strong>Jan Van Der</strong> Veer vooral actief en bekend is in de provinciale reeksen van onze provincie als keeper van K.F.C. Duffel, Berlaar-Heikant, Leest en KFC Zoersel. Jan is vandaag keeperstrainer van het 1e elftal van K. Kontich F.C..</p>\n<p>Met hun ervaring streven zij er naar om jonge keepers zowel op technisch, tactisch, als op fysiek en mentaal vlak sterker te maken.</p>\n<p>Keepersschool &lsquo;Clean Sheet&rsquo; wordt ondersteund door Voetbalspeciaalzaak Nick Sport, kledingsmerk Jako en Footline.</p>\n<h3>Wanneer vinden de trainingssessies plaats?</h3>\n<p><strong>Vanaf 2 september 2019</strong>&nbsp;wordt er <strong>telkens op maandagavond (en dinsdagavond)</strong> getraind, telkens van&nbsp;<strong>18u00 tot 20u00</strong>. De trainingen duren &eacute;&eacute;n uur, waarbij de jongere keepers om 18u00 starten.</p>\n<h3>Waar vinden de trainingssessies plaats?</h3>\n<p>&lsquo;Clean Sheet&rsquo; wordt logistiek en administratief ondersteund door de club K. Kontich F.C.<br />De trainingen vinden dan ook plaats op de terreinen van K. Kontich F.C. (Duffelsesteenweg 73 &ndash; Kontich). Er wordt getraind op het kunstgrasveld, terwijl de keepers ook de gelegenheid hebben om te douchen.</p>\n<h3>Wie is er welkom?</h3>\n<p>Iedere jeugdkeeper of -keepster vanaf 8 jaar. Een eerste ervaring in doel &eacute;n een gezonde ambitie om als keeper te evolueren zijn alleszins noodzakelijke voorwaarden.</p>\n<h3>Hoe kan je je inschrijven?</h3>\n<ul>\n  <li>Er wordt voorrang gegeven aan de <strong><u>keepers die dit seizoen reeds lid waren</u></strong> van keepersschool Clean Sheet. <br />Hun betaling voor 31 mei a.s. op rekening van K. Kontich F.C. met rekeningnummer <strong>BE82 1030 3848 9668</strong> geldt als bevestiging;</li>\n  <li><strong><u><span lang=\"NL\">Nieuwe, ge&iuml;nteresseerde keepers</span></u></strong><span lang=\"NL\"> kunnen inschrijven via <strong>e-mail</strong> naar <a title=\"info@kkontichfc.be\" href=\"mailto:info@kkontichfc.be\">info@kkontichfc.be</a> met vermelding van je naam, adres, huidige club en leeftijd. <br />Na bevestiging zal je verzocht worden om het inschrijvingsgeld over te maken op rekening van K. Kontich F.C. met rekeningnummer</span> <strong><span lang=\"NL\">BE82 1030 3848 9668;</span></strong></li>\n  <li><strong><span lang=\"NL\"><u>Deelnameprijs </u>voor 30 trainingssessies</span></strong><span lang=\"NL\">(15 trainingen v&oacute;&oacute;r 1/1/2020, 15 trainingen na 1/1/2020) bedraagt:</span><span lang=\"NL\"><br />- voor niet-leden van K. Kontich F.C. : 250 EUR;<br />- voor leden van K. Kontich F.C.: 100 EUR;</span></li>\n</ul>\n<p>Wie meer infomatie wil, dient te e-mailen naar <a title=\"info@kkontichfc.be\" href=\"mailto:info@kkontichfc.be\">info@kkontichfc.be</a>!</p>","bodyHtml":"<p>Tijdens de terugronde van het seizoen 2017-2018 organiseerden <strong>Kris Mampaey &amp; Jan Van der Veer</strong> verschillende try-outs voor de opstart van een keepersschool. Op basis van de positieve reacties &eacute;n de duidelijk waarneembare evolutie van de deelnemende keepers, werd beslist om keepersschool &lsquo;Clean Sheet&rsquo; boven het doopvont te houden.</p>\n<h3>Wat is &lsquo;Clean Sheet&rsquo;?</h3>\n<p>&lsquo;Clean Sheet&rsquo; is de keepersschool van niemand minder dan Kris Mampaey &eacute;n Jan Van Der Veer.</p>\n<p><strong>Kris Mampaey</strong> was profvoetballer in de periode van 1991 tot 2005 en stond onder de lat bij S.K. Lierse, Willem II Tilburg (waar hij onder andere Champions League speelde), het Schotse Dunfermline, R. Antwerp F.C. en F.C. Den Bosch, terwijl <strong>Jan Van Der</strong> Veer vooral actief en bekend is in de provinciale reeksen van onze provincie als keeper van K.F.C. Duffel, Berlaar-Heikant, Leest en KFC Zoersel. Jan is vandaag keeperstrainer van het 1e elftal van K. Kontich F.C..</p>\n<p>Met hun ervaring streven zij er naar om jonge keepers zowel op technisch, tactisch, als op fysiek en mentaal vlak sterker te maken.</p>\n<p>Keepersschool &lsquo;Clean Sheet&rsquo; wordt ondersteund door Voetbalspeciaalzaak Nick Sport, kledingsmerk Jako en Footline.</p>\n<h3>Wanneer vinden de trainingssessies plaats?</h3>\n<p><strong>Vanaf 2 september 2019</strong>&nbsp;wordt er <strong>telkens op maandagavond (en dinsdagavond)</strong> getraind, telkens van&nbsp;<strong>18u00 tot 20u00</strong>. De trainingen duren &eacute;&eacute;n uur, waarbij de jongere keepers om 18u00 starten.</p>\n<h3>Waar vinden de trainingssessies plaats?</h3>\n<p>&lsquo;Clean Sheet&rsquo; wordt logistiek en administratief ondersteund door de club K. Kontich F.C.<br />De trainingen vinden dan ook plaats op de terreinen van K. Kontich F.C. (Duffelsesteenweg 73 &ndash; Kontich). Er wordt getraind op het kunstgrasveld, terwijl de keepers ook de gelegenheid hebben om te douchen.</p>\n<h3>Wie is er welkom?</h3>\n<p>Iedere jeugdkeeper of -keepster vanaf 8 jaar. Een eerste ervaring in doel &eacute;n een gezonde ambitie om als keeper te evolueren zijn alleszins noodzakelijke voorwaarden.</p>\n<h3>Hoe kan je je inschrijven?</h3>\n<ul>\n  <li>Er wordt voorrang gegeven aan de <strong><u>keepers die dit seizoen reeds lid waren</u></strong> van keepersschool Clean Sheet. <br />Hun betaling voor 31 mei a.s. op rekening van K. Kontich F.C. met rekeningnummer <strong>BE82 1030 3848 9668</strong> geldt als bevestiging;</li>\n  <li><strong><u><span lang=\"NL\">Nieuwe, ge&iuml;nteresseerde keepers</span></u></strong><span lang=\"NL\"> kunnen inschrijven via <strong>e-mail</strong> naar <a title=\"info@kkontichfc.be\" href=\"mailto:info@kkontichfc.be\">info@kkontichfc.be</a> met vermelding van je naam, adres, huidige club en leeftijd. <br />Na bevestiging zal je verzocht worden om het inschrijvingsgeld over te maken op rekening van K. Kontich F.C. met rekeningnummer</span> <strong><span lang=\"NL\">BE82 1030 3848 9668;</span></strong></li>\n  <li><strong><span lang=\"NL\"><u>Deelnameprijs </u>voor 30 trainingssessies</span></strong><span lang=\"NL\">(15 trainingen v&oacute;&oacute;r 1/1/2020, 15 trainingen na 1/1/2020) bedraagt:</span><span lang=\"NL\"><br />- voor niet-leden van K. Kontich F.C. : 250 EUR;<br />- voor leden van K. Kontich F.C.: 100 EUR;</span></li>\n</ul>\n<p>Wie meer infomatie wil, dient te e-mailen naar <a title=\"info@kkontichfc.be\" href=\"mailto:info@kkontichfc.be\">info@kkontichfc.be</a>!</p>","preview":"Tijdens de terugronde van het seizoen 2017-2018 organiseerden Kris Mampaey &amp; Jan Van der Veer","dir":"content/build/nieuws/2019-2020/algemeen","base":"keepersschool-clean-sheet.json","ext":".json","sourceBase":"keepersschool-clean-sheet.md","sourceExt":".md"};

