module.exports = {"title":"Kaily Dhondt naar KKFC!","figCaption":"Kaily Dhont","date":"2019-05-19T00:00:00.000Z","cloudinaryID":"179_1_pujzf0","bodyContent":"<p>De damesafdeling van K. Kontich F.C. versterkte zich met de 18-jarige Kaily Dhondt.</p>\n<p>Kaily startte haar voetballoopbaan bij K.F.C.O. Beerschot-Wilrijk, alvorens ze naar SK Lierse, SK Beveren en Svelta Melsele trok. Het voorbije seizoen was Kaily speelster bij K.A.A. Gent Ladies. Kaily treedt eveneens aan bij de Red Flames U19.</p>\n<p><strong>Van harte welkom, Kaily! </strong></p>","bodyHtml":"<p>De damesafdeling van K. Kontich F.C. versterkte zich met de 18-jarige Kaily Dhondt.</p>\n<p>Kaily startte haar voetballoopbaan bij K.F.C.O. Beerschot-Wilrijk, alvorens ze naar SK Lierse, SK Beveren en Svelta Melsele trok. Het voorbije seizoen was Kaily speelster bij K.A.A. Gent Ladies. Kaily treedt eveneens aan bij de Red Flames U19.</p>\n<p><strong>Van harte welkom, Kaily! </strong></p>","preview":"De damesafdeling van K. Kontich F.C. versterkte zich met de 18-jarige Kaily Dhondt.\nKaily startte haar","dir":"content/build/nieuws/2019-2020/dames","base":"kaily-dhont-naar-kkfc.json","ext":".json","sourceBase":"kaily-dhont-naar-kkfc.md","sourceExt":".md"};

