module.exports = {"title":"Geschiedenis","bodyContent":"<p><strong>K. Kontich F.C. kent een rijke geschiedenis...</strong></p>\n\n<h2>Beginjaren</h2>\n<p>Eind jaren dertig vochten de voetballers van Groeninghe Sport en de Kontich Boys in onze gemeente herosche derbys uit in het Antwerpse liefhebbersverbond...</p>\n\n<p>Enkele jaren later brak de Tweede Wereldoorlog uit. Om te ontsnappen aan de ellende van de oorlog en de krijgsgevangenkampen werd er beslist om de lijnen opnieuw te krijten, de ballen opnieuw op te pompen en de voetbalshirts opnieuw nat te maken: Kontich A.C. werd in juli 1941 geboren en kreeg van de Koninklijke Belgische Voetbalbond het stamnummer 3029 toebedeeld.</p>\n\n<p>Op initiatief van toenmalig burgemeester Apers sloot Groeninghe Sport zich een jaar later aan bij het nieuwe voetbalproject en werd de club herdoopt tot Kontich Football Club.</p>\n<br/>\n\n<h2>Bevordering</h2>\n<p>Tijdens de oorlogsjaren speelde onze club in derde provinciale. En met succes, want in het seizoen 1943-1944 werd de promotie naar tweede provinciale afgedwongen. Na 8 jaren in de tweede provinciale vertoefd te hebben, werd in het seizoen 1952-1953 geen enkele keer verloren: Kontich Football Club promoveerde naar de eerste provinciale!</p>\n\n<p>Amper n jaar later was het opnieuw raak: in een prachtige wedstrijd op Heist-op-den-Berg, bijgewoond door een 4.000-tal toeschouwers, verzekerde onze club zich van de promotie naar de nationale afdelingen.</p>\n\n<p>Na zeven rustige jaren in bevordering volgde in 1961 d apotheose: Kontich Football Club promoveerde naar derde nationale en mocht in die reeks aantreden tegen de buren van Boom, Willebroek, Racing Mechelen, Lyra en Tubantia.</p>\n\n<p>In 1965 zakte de club echter naar de provinciale reeksen, waar het gedurende decennia zou blijven zweven tussen de derde en de eerste provinciale.</p>\n\n<p>Het duurde tot de eeuwwisseling voordat Koninklijke (in 1992 verkreeg de club deze titel omwille van haar 50-jarig bestaan) Kontich Football Club terug naar de nationale reeksen zou promoveren. De club professionaliseerde maar kon dit  op een zucht van de derde klasse  niet langer financieren.</p>\n<br/>\n\n<h2>Heden</h2>\n<p>De club besliste de tering naar de nering te zetten en komt nu in tweede provinciale uit. Spelers uit Kontich en omgeving maken nu de borst nat om op een gezonde financile basis te timmeren aan de sportieve en structurele uitbouw van onze club. In het seizoen 2016-2017 kroonde ons eerste elftal van de mannen zich tot kampioen van hun reeks en beukten zij de poort naar 1e provinciale eindelijk open.\n</p>\n\n<p><strong>K. Kontich F.C., een club met een rijk verleden en een nog mooiere toekomst!</strong></p>","bodyHtml":"<p><strong>K. Kontich F.C. kent een rijke geschiedenis...</strong></p>\n<h2>Beginjaren</h2>\n<p>Eind jaren dertig vochten de voetballers van Groeninghe Sport en de Kontich Boys in onze gemeente herosche derbys uit in het Antwerpse liefhebbersverbond...</p>\n<p>Enkele jaren later brak de Tweede Wereldoorlog uit. Om te ontsnappen aan de ellende van de oorlog en de krijgsgevangenkampen werd er beslist om de lijnen opnieuw te krijten, de ballen opnieuw op te pompen en de voetbalshirts opnieuw nat te maken: Kontich A.C. werd in juli 1941 geboren en kreeg van de Koninklijke Belgische Voetbalbond het stamnummer 3029 toebedeeld.</p>\n<p>Op initiatief van toenmalig burgemeester Apers sloot Groeninghe Sport zich een jaar later aan bij het nieuwe voetbalproject en werd de club herdoopt tot Kontich Football Club.</p>\n<br/>\n<h2>Bevordering</h2>\n<p>Tijdens de oorlogsjaren speelde onze club in derde provinciale. En met succes, want in het seizoen 1943-1944 werd de promotie naar tweede provinciale afgedwongen. Na 8 jaren in de tweede provinciale vertoefd te hebben, werd in het seizoen 1952-1953 geen enkele keer verloren: Kontich Football Club promoveerde naar de eerste provinciale!</p>\n<p>Amper n jaar later was het opnieuw raak: in een prachtige wedstrijd op Heist-op-den-Berg, bijgewoond door een 4.000-tal toeschouwers, verzekerde onze club zich van de promotie naar de nationale afdelingen.</p>\n<p>Na zeven rustige jaren in bevordering volgde in 1961 d apotheose: Kontich Football Club promoveerde naar derde nationale en mocht in die reeks aantreden tegen de buren van Boom, Willebroek, Racing Mechelen, Lyra en Tubantia.</p>\n<p>In 1965 zakte de club echter naar de provinciale reeksen, waar het gedurende decennia zou blijven zweven tussen de derde en de eerste provinciale.</p>\n<p>Het duurde tot de eeuwwisseling voordat Koninklijke (in 1992 verkreeg de club deze titel omwille van haar 50-jarig bestaan) Kontich Football Club terug naar de nationale reeksen zou promoveren. De club professionaliseerde maar kon dit  op een zucht van de derde klasse  niet langer financieren.</p>\n<br/>\n<h2>Heden</h2>\n<p>De club besliste de tering naar de nering te zetten en komt nu in tweede provinciale uit. Spelers uit Kontich en omgeving maken nu de borst nat om op een gezonde financile basis te timmeren aan de sportieve en structurele uitbouw van onze club. In het seizoen 2016-2017 kroonde ons eerste elftal van de mannen zich tot kampioen van hun reeks en beukten zij de poort naar 1e provinciale eindelijk open.\n</p>\n<p><strong>K. Kontich F.C., een club met een rijk verleden en een nog mooiere toekomst!</strong></p>","preview":"K. Kontich F.C. kent een rijke geschiedenis...\n\nBeginjaren\nEind jaren dertig vochten de voetballers van","dir":"content/build/pages/info","base":"geschiedenis.json","ext":".json","sourceBase":"geschiedenis.md","sourceExt":".md"};

