module.exports = {"title":"Secretariaat","bodyContent":"<p>U kan terecht op het secretariaat van onze club voor aansluitingen, ongevallendossiers, het terugbetalingsformulier van de lidgelden door de ziekenfondsen, e.d. Het secretariaat wordt ingericht in de spreekkamer onder de tribune.</p>\n\n<p><strong>Het secretariaat wordt tijdens het voetbalseizoen bemand door onze gerechtigd correspondent Theo Knegtel en bestuurslid Glenn Marin en wel op volgende openingsuren:</strong></p>\n<ul>\n    <li>elke dinsdag van 18u45 tot 19u45;</li>\n    <li>elke woensdag van 17u45 tot 18u45;</li>\n</ul>\n\n<p>Uiteraard kan u ook steeds mailen naar <a href=\"mailto:jeugd@kkontichfc.be\" title=\"jeugd@kkontichfc.be\">jeugd@kkontichfc.be</a> en <a href=\"mailto:gc@kkontichfc.be\" title=\"gc@kkontichfc.be\">gc@kkontichfc.be</a>!</p>","bodyHtml":"<p>U kan terecht op het secretariaat van onze club voor aansluitingen, ongevallendossiers, het terugbetalingsformulier van de lidgelden door de ziekenfondsen, e.d. Het secretariaat wordt ingericht in de spreekkamer onder de tribune.</p>\n<p><strong>Het secretariaat wordt tijdens het voetbalseizoen bemand door onze gerechtigd correspondent Theo Knegtel en bestuurslid Glenn Marin en wel op volgende openingsuren:</strong></p>\n<ul>\n    <li>elke dinsdag van 18u45 tot 19u45;</li>\n    <li>elke woensdag van 17u45 tot 18u45;</li>\n</ul>\n<p>Uiteraard kan u ook steeds mailen naar <a href=\"mailto:jeugd@kkontichfc.be\" title=\"jeugd@kkontichfc.be\">jeugd@kkontichfc.be</a> en <a href=\"mailto:gc@kkontichfc.be\" title=\"gc@kkontichfc.be\">gc@kkontichfc.be</a>!</p>","preview":"U kan terecht op het secretariaat van onze club voor aansluitingen, ongevallendossiers, het","dir":"content/build/pages/info","base":"secretariaat.json","ext":".json","sourceBase":"secretariaat.md","sourceExt":".md"};

